import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './home';
import Website from './Website';

export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="Website" element={<Website />} />
        </Routes>
      </BrowserRouter>
      <Home />
    </div>
  );
}
